import React from 'react'
import ButtonBase from "@material-ui/core/ButtonBase";
import {Link} from "react-router-dom";
import Typography from "@material-ui/core/Typography";
import {useStyles} from "./Home.style";

const BoxVariant = React.memo((props) => {
    const classes = useStyles();
    const {image} = props

    return (
        <ButtonBase
            component={Link} to={image.to}
            style={{transform: `rotate(${image.rotate}deg)`}}
            focusRipple
            className={classes.image}
            focusVisibleClassName={classes.focusVisible}
            p={5}
        >
          <span
              className={classes.imageSrc}
              style={{
                  backgroundImage: `url(${image.url})`,
              }}
          />
            <span className={classes.imageBackdrop}/>
            <span className={classes.imageButton}>
            <Typography
                component="span"
                variant="subtitle1"
                color="inherit"
                className={classes.imageTitle}
            >
              {image.title}
            </Typography>
          </span>
        </ButtonBase>
    )
})


const BoxList = React.memo((props) => {
    const {images} = props
    const classes = useStyles()

    return (
        <div className={classes.root} m={1} p={1}>
            {images.map(image => <BoxVariant key={image.title} image={image}/>)}
        </div>
    )
})

export default BoxList
